var results={animation:3.5},buildListResults=[];function getData(){$.ajax({url:AppURL.results,type:"GET",dataType:"json",cache:!0,complete:function(i){var t=i.responseJSON.data_results;results.giaidacbiet=t.giaidacbiet,results.giainhat=t.giainhat,results.giainhi=t.giainhi,results.giaikhuyenkhich=t.giaikhuyenkhich,results.bgimg=i.responseJSON.bgimg,results.bgimg&&setTimeout(function(){$("body").css({"background-image":"url("+results.bgimg+")"})},200),getGiaiThuong()}})}function putData(i,t,a){buildListResults.push('<tr><td colspan="5" class="namegiai">'+a+" - "+i.length+" giải</td></tr>");for(var s=0;s<i.length;s++){var e=i[s].split(";"),u="<tr><td>"+(s+1)+"</td><td>"+e[3]+"</td><td>"+e[4]+"</td><td>"+e[5]+"</td><td>"+e[6]+"</td><tr>";buildListResults.push(u)}}function getGiaiThuong(){putData(results.giaidacbiet,"giaidacbiet","Giải đặc biệt"),putData(results.giainhat,"giainhat","Giải nhất"),putData(results.giainhi,"giainhi","Giải nhì"),putData(results.giaikhuyenkhich,"giaikhuyenkhich","Giải khuyến khích"),$("#lists-op table tbody").append(buildListResults)}getData();